import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import PracSer from './PracSer';

function Prac() {
  let navigate = useNavigate();

  const [emp, setEmp] = useState({
    currentMarketValue: '',
    carpetArea: '',
    pincode: '',
    buildingAge: '',
    propertyEffect: '',
    security24x7: '',
    isSalaried: ''
  });

  const [errorMessages, setErrorMessages] = useState({
    currentMarketValue: '',
    carpetArea: '',
    pincode: '',
    buildingAge: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEmp({ ...emp, [name]: value });
    validateField(name, value);
  };

  const validateField = (fieldName, value) => {
    const numberRegex = /^[1-9][0-9]*$/;
    let errorMessage = '';

    if (!numberRegex.test(value)) {
      errorMessage = 'Please enter a valid number.';
    }

    setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: errorMessage }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validateInputs()) {
      saveDataToDatabase();
    } else {
      console.log('Form submission failed. Please enter valid numbers.');
    }
  };

  const validateInputs = () => {
    const { currentMarketValue, carpetArea, pincode, buildingAge } = emp;
    const numberRegex = /^[1-9][0-9]*$/;

    let isValid = true;

    const validateField = (fieldName, value) => {
      let errorMessage = '';

      if (!numberRegex.test(value)) {
        errorMessage = 'Please enter a valid number.';
        isValid = false;
      }

      setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: errorMessage }));
    };

    validateField('currentMarketValue', currentMarketValue);
    validateField('carpetArea', carpetArea);
    validateField('pincode', pincode);
    validateField('buildingAge', buildingAge);

    return isValid;
  };

  const saveDataToDatabase = () => {
    PracSer.createEmp(emp)
      .then(res => {
        navigate('/');
      })
      .catch(error => {
        console.error('Error saving user property details:', error);
      });
  };

  return (
    <div className='container mt-3'>
      <div className='row'>
        <div className='card col-md-6 oddset-md-3'>
          <h3 className='text-center'>Input</h3>
          <div className='card-body'>
            <form onSubmit={handleSubmit}>
              <div className='form-group'>
                <label>Current Market Value</label>
                <input
                  type='text'
                  name='currentMarketValue'
                  className='form-control'
                  placeholder='Current Market Value'
                  value={emp.currentMarketValue}
                  onChange={handleChange}
                />
                <p className='error-message'>{errorMessages.currentMarketValue}</p>
              </div>

              <div className='form-group'>
                <label>Carpet Area</label>
                <input
                  type='text'
                  name='carpetArea'
                  className='form-control'
                  placeholder='Carpet Area'
                  value={emp.carpetArea}
                  onChange={handleChange}
                />
                <p className='error-message'>{errorMessages.carpetArea}</p>
              </div>

              <div className='form-group'>
                <label>Building Age</label>
                <input
                  type='text'
                  name='buildingAge'
                  className='form-control'
                  placeholder='Building Age'
                  value={emp.buildingAge}
                  onChange={handleChange}
                />
                <p className='error-message'>{errorMessages.buildingAge}</p>
              </div>

              <div className='form-group'>
                <label>Pincode</label>
                <input
                  type='text'
                  name='pincode'
                  className='form-control'
                  placeholder='Pincode'
                  value={emp.pincode}
                  onChange={handleChange}
                />
                <p className='error-message'>{errorMessages.pincode}</p>
              </div>

              <div className='form-group'>
                <button type='submit' className='btn btn-success'>Save</button>
                <button className='btn btn-danger' onClick={() => navigate('/home')}>Cancel</button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Prac;
